import { Fragment, useState } from "react";
import UserCard from "./UserCard";




export default function List() {

    const style =

    {
        div: {
            background: "lightBlue",
            padding: "10px",
            textAlign: "center",

        },
        box: {
            justifyContent: "center",
            display: "flex",
            marginTop: "20px"
        }
    }

    // 


    return (

        <Fragment>

            <h1>Usuarios</h1>
            {users.map(user => {
                return (
                    <Box sx={{ flexGrow: 1 }} style={style.box}>

                        <Grid container spacing={2}>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.nombre}
                                </div>


                            </Grid>
                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.apellido}
                                </div>


                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.dni}
                                </div>

                            </Grid>

                            <Grid item xs={3} md={2}>

                                <div style={style.div}>
                                    {user.fecha}
                                </div>

                            </Grid>

                        </Grid>

                    </Box>
                )
            })}

        </Fragment>
    )

}
